import { Image, ImageBackground, StyleSheet, Text, View } from "react-native";
import React from "react";
import Appbartab from "../components/Appbartab";
import Bottombar from "../components/Bottombar";
import { Dimensions } from "react-native";
import { Button } from "react-native-paper";

const { width, height } = Dimensions.get("screen");
const Doctorinfo = () => {
  return (
    <View>
      <Appbartab />
      <View
        style={{
          margin: 30,
          borderWidth: 0,
          width: width * 0.85,
          height: height * 0.23,
          flexDirection: "row",
          backgroundColor: "#BCEAD5",
          borderRadius: 20,
        }}
      >
        <View style={{ margin: 0, borderWidth: 0, width: 100 }}>
          <Image
            style={{ width: 110, height: 110, marginTop: 10 }}
            source={require("../images/doctor.png")}
          />
        </View>
        <View
          style={{
            marginTop: 10,
            marginBottom: 10,
            borderWidth: 0,
            width: 220,
          }}
        >
          <View style={{ flexDirection: "row" }}>
            <Image
              style={{ width: 20, height: 20, marginTop: 10, marginLeft: 10 }}
              source={require("../images/name1.png")}
            />
            <Text style={{ margin: 10, marginTop: 5 }}>Dr. Drishti Gupta</Text>
          </View>
          <View style={{ flexDirection: "row" }}>
            <Image
              style={{ width: 20, height: 20, marginTop: 10, marginLeft: 10 }}
              source={require("../images/qualification.png")}
            />
            <Text style={{ margin: 10, marginTop: 5 }}>Heart Specialist</Text>
          </View>
          <View style={{ flexDirection: "row" }}>
            <Image
              style={{ width: 20, height: 20, marginTop: 10, marginLeft: 10 }}
              source={require("../images/experience.png")}
            />
            <Text style={{ margin: 10, marginTop: 8 }}>4+years</Text>
          </View>

          <View style={{ flexDirection: "row" }}>
            <Image
              style={{ width: 20, height: 20, marginTop: 10, marginLeft: 10 }}
              source={require("../images/license.png")}
            />

            <Text style={{ margin: 10, marginTop: 8 }}>
              License No. - 12345
            </Text>
          </View>
        </View>
      </View>
      <View style={{margin:50}}>
        <Button
          icon="chat"
          mode="elevated"
          onPress={() => console.log("Pressed")}
        >
          Chat with Doctor
        </Button>
      </View>
      <View style={{marginTop:310}}>
        <Bottombar />
      </View>
    </View>
  );
};

export default Doctorinfo;

const styles = StyleSheet.create({});
